import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function Home() {
  return (
    <View style={styles.navbar}>
      <Text>Home</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  navbar:{
    marginTop:50,
  }
})
